import { useContext } from "react";
import { Link } from "react-router-dom";
import AuthContext from "../context";
const Navbar = () => {
  const { token } = useContext(AuthContext);

  return (
    <div className="h-15 flex items-center justify-between  bg-white w-[100%] border-b-[1px] border-black">
      <Link to="/">
        <img
          src={"/ICON-Student-2.png"}
          className="flex cursor-pointer my-auto sm: w-10/12 h-24 md:w-30 md:h-20 lg:w-50 lg:h-38 mr-16 p-4"
        />
      </Link>
      {token ? (
        <p className="font-bold text-xl p-5">Welcome</p>
      ) : (
        <Link to="/register">
          <p className="font-bold text-xl p-5">Register</p>
        </Link>
      )}
    </div>
  );
};

export default Navbar;
